const EventInfo = props => {

      return (
        <div className='event'>
          <h1>{props.results.location[0].city.displayName}</h1>
        </div>
      );

  };

class EventCard extends React.Component {
    render() {

      const { eventData } = this.props;
      return <EventInfo eventData={eventData} />;
    }
  }

  export default EventCard;
